PROBLEM TYPE:
  PROBLEMTYPE: "Particle"
IO:
  STDOUTEVERY: 100
  VERBOSITY: "Standard"
BINNING STRATEGY:
  BIN_SIZE_LOWER_BOUND: 0.035
  DOMAINBOUNDINGBOX: "-0.15 -0.1 -0.025 0.15 0.1 0.025"
PARTICLE DYNAMIC:
  INTERACTION: "SPH"
  RESULTSEVERY: 10
  RESTARTEVERY: 400
  NUMSTEP: 500
  MAXTIME: 50
  PHASE_TO_DYNLOADBALFAC: "phase1 1.0 boundaryphase 1.0 dirichletphase 1.0 neumannphase 1.0"
  PHASE_TO_MATERIAL_ID: "phase1 1 boundaryphase 2 dirichletphase 1 neumannphase 1"
PARTICLE DYNAMIC/SPH:
  KERNEL: "QuinticSpline"
  KERNEL_SPACE_DIM: "Kernel2D"
  INITIALPARTICLESPACING: 0.01
  BOUNDARYPARTICLEFORMULATION: "AdamiBoundaryFormulation"
  TRANSPORTVELOCITYFORMULATION: "StandardTransportVelocity"
  DIRICHLETBOUNDARYTYPE: "DirichletNormalToPlane"
  DIRICHLET_FUNCT: 1
  DIRICHLET_OUTWARD_NORMAL: "-1.0 0.0 0.0"
  DIRICHLET_PLANE_POINT: "-0.1 0.0 0.0"
  NEUMANNBOUNDARYTYPE: "NeumannNormalToPlane"
  NEUMANN_OUTWARD_NORMAL: "1.0 0.0 0.0"
  NEUMANN_PLANE_POINT: "0.1 0.0 0.0"
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "a*0.1*(-400.0*y*y+1.0)"
  - VARIABLE: 0
    NAME: "a"
    TYPE: "multifunction"
    NUMPOINTS: 3
    TIMES: [0, 1, 1000]
    DESCRIPTION: ["0.5*(1.0-cos((t*pi)/1.0))", "1.0"]
MATERIALS:
  - MAT: 1
    MAT_ParticleSPHFluid:
      INITRADIUS: 0.03
      INITDENSITY: 1
      REFDENSFAC: 1
      EXPONENT: 1
      BACKGROUNDPRESSURE: 1
      BULK_MODULUS: 1
      DYNAMIC_VISCOSITY: 0.001
      BULK_VISCOSITY: 0
      ARTIFICIAL_VISCOSITY: 0
  - MAT: 2
